	@Test
	public void GameInstanceVariablesTest() {
		Game testSong = new Game("MyGame",new Date(1000),"PS5");
		@SuppressWarnings("rawtypes")
		Class c = testSong.getClass();
		
		try {
			c.getDeclaredField("name");
			c.getDeclaredField("date");
			c.getDeclaredField("console");
			
			assertEquals("You must make your instance variables private.",true,Modifier.isPrivate(c.getDeclaredField("name").getModifiers()));
			assertEquals("You must make your instance variables private.",true,Modifier.isPrivate(c.getDeclaredField("date").getModifiers()));
			assertEquals("You must make your instance variables private.",true,Modifier.isPrivate(c.getDeclaredField("console").getModifiers()));
		}
		catch(NoSuchFieldException e) {
			fail("Could not find the " + e.getLocalizedMessage().toString() + " instance variable");
		}
		catch(Exception e) {
			fail("Something weird went wrong");
		}
	}

	@Test
	public void GameConstructorTest() {
		Game testGame = new Game("Kingdom Hearts",new Date(1016840140875L),"PS2");
		@SuppressWarnings("rawtypes")
		Class c = testGame.getClass();
		try {
			Field name = c.getDeclaredField("name");
			name.setAccessible(true);
			String nameValue = (String) name.get(testGame);
			assertEquals("When checking the value of title we","Kingdom Hearts",nameValue);
			
			Field date = c.getDeclaredField("date");
			date.setAccessible(true);
			Date dateValue = (Date) date.get(testGame);
			assertEquals("When checking the value of title we",new Date(1016840140875L),dateValue);
			
			Field console = c.getDeclaredField("console");
			console.setAccessible(true);
			String consoleValue = (String) console.get(testGame);
			assertEquals("When checking the value of title we","PS2",consoleValue);
		} catch (Exception e) {
			fail(e.toString());
		}
	}
	
